import React from 'react';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';
import '../css/FirstPage.css'; // 스타일 파일을 임포트
import WeekDays from '../utils/weekDaysSlider';
import BannerSlider from '../utils/bannerSlider';



const FirstPage = () => {
    const navigate = useNavigate();

    const handlePageChange = (path) => {
        navigate(path);
    }

    const [boards, setBoards] = useState([]);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState(null);
    const [currentPage, setCurrentPage] = useState(0); // 현재 페이지
    const pageSize = 10; // 페이지 당 보여질 아이템 수

    const fetchBoards = async () => {
        try {
          const response = await axiosInstance.get('/api/boards/main', {
            params: {
              page: currentPage,
              pageSize: pageSize,
            },
            headers: {
              Authorization: `Bearer ${localStorage.getItem('token')}`,
            },
          });

          setBoards(response.data.data);
        } catch (error) {
          console.error('Error fetching boards:', error);
          setError('게시판 목록을 가져오는 중 오류가 발생했습니다.');
        } finally {
          setLoading(false);
        }
      };

    return (
        <div className='container'>
            <div className='navbar'>
                <div className='userMenu'>
                    <div>
                        <h1 onClick={() => handlePageChange('/')} className='clickable-text'>런닝크루</h1>
                    </div>

                    <div className='searchBox'>
                        <input type="text"
                            placeholder='지역 크루로 찾기'
                            className='searchInput'/>

                        <button
                            id='search-Btn'>
                            <img src='/images/searchImage.png' alt='search icon' className='search-Img'/>
                        </button>
                        </div>

                    <div className='login'>
                        <h1 onClick={() => handlePageChange('/login')} className='clickable-text'>로그인</h1>   
                    </div>
                </div>
            </div>

            <div className='navigation__wrapper'>
            <div className='navigation__item'>
                    <h2 onClick={() => handlePageChange('/')} className='clickable-text'>번개런닝</h2>
                </div>
                <div className='navigation__item'>
                    <h2 onClick={() => handlePageChange('/crew')} className='clickable-text'>크루</h2>
                </div>
                <div className='navigation__item'>
                    <h2 onClick={() => handlePageChange('/challenge')} className='clickable-text'>챌린지</h2>
                </div>
            </div>

            <div>
                <BannerSlider />
            </div>

            <div>
                <WeekDays /> {/* WeekDays 컴포넌트를 렌더링 */}
            </div>

            <div className='main__filter'>
                <div className='filter--wrapper'>
                    <ul>
                        <li className='clickable-text'>
                            <span>지역</span>
                        </li>
                        <li className='clickable-text'>
                            <span>마감 가리기</span>
                        </li>
                        <li className='clickable-text'>
                            <span>성별</span>
                        </li>
                        <li className='clickable-text'>
                            <span>거리별</span>
                        </li>
                    </ul>
                </div>
            </div>

              <div>
      <h1>Board List</h1>
      <ul>
        {boards.map((board) => (
          <li key={board.id}>
            <h2>{board.title}</h2>
            <p>{board.content}</p>
          </li>
        ))}
      </ul>
      <div>
      </div>
    </div>

        </div>




    );
};

export default FirstPage;
